$( document ).ready(function() {
  $(document).on('click', ".notification", function(){
    var sender_id = $('#sender_id').val()
    $.ajax({
      type: 'PUT',
      url: '/sender_recipients/' + sender_id,
      data: {abc: abc}
    });
  });
});
